  HelveticaneueCondensedBoldBlack80px,
  HelveticaneueBoldBlack35px,
} from "../../styledMixins";
import "./LandingPage2.css";

class LandingPage2 extends React.Component {
  render() {
    const {
      shop,
      markusSpiske3Dw6Ie9X3Q0Unsplash,
